import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PokerComponent from 'components/PokerComponent';
import Playboard from './components/Playboard';
import { WebSocketProvider } from './WebSocketContext';

const App = () => {
    return (
        <WebSocketProvider>
            <Router>
                <Routes>
                    <Route path="/" element={<PokerComponent />} />
                    <Route path="/play/:tableId" element={<Playboard />} />
                </Routes>
            </Router>
        </WebSocketProvider>
    );
};

export default App;
